import "./BotonTutoriales.scss";

export default function BotonTutoriales() {
    return (
        <div className='card-tutoriales'>
            <a className='link-tutoriales' href="https://www.youtube.com/user/CRCCol" Target="_blank">
                Video Tutoriales
            </a>
        </div>
    )
}
